import React from 'react'


const Blog = ({ blog, details, viewLabel, viewFunction, likeFunction}) => {

  const blogStyle = {
    paddingTop: 10,
    paddingLeft: 2,
    border: 'solid',
    borderWidth: 1,
    marginBottom: 5
  }


  if (details){
    return (
    <div style={blogStyle}>
      <p>{blog.title} {blog.author} <button onClick={viewFunction}>{viewLabel}</button> </p>
      <p>{blog.url}</p>
      <p>likes {blog.likes} <button onClick={likeFunction}>like</button></p>
      <p>{blog.user.name}</p>
    </div>
    )
  }
  return (
    <div style={blogStyle}>
      {blog.title} {blog.author} <button onClick={viewFunction}>{viewLabel}</button>
    </div>
  )
}
export default Blog
